import Link from 'next/link'
import Layout from '../components/layout'
const about = () => {
    return (
       <Layout>
            <div>
            about
            <Link href="/">
                <a> Go to Home</a>
            </Link>
        </div>
       </Layout>
    );
};
export default about;
